// src/components/About.jsx
import React from 'react';

function About() {
  return (
    <section>
      <h2>About Me</h2>
      <img src="path/to/photo.jpg" alt="Developer" />
      <p>Short bio about the developer...</p>
    </section>
  );
}

export default About;
